CREATE DEFINER=`root`@`%` PROCEDURE `SP_ANULAR_COMUNICACION_DE_BAJA_A_CPE_RECHAZADO`()
begin
	declare tempv int(11) default 0;
	declare done char(1) default 0;
	declare CpesR cursor for select tempBajas.NUM_CPE
							from (
									select 
										cab.NUM_CPE, cab.COD_TIP_CPE, cab.FEC_EMIS, cab.TXT_SERIE, 
										cab.TXT_CORRELATIVO, cab.COD_ESTADO_DOC, cab.COD_ESTADO_SUNAT,
										cab.COD_CLIENTE_EMIS, cab.COD_IDEN_CB 
									from tbl_cpe_cabecera as cab 
									where 
										cab.COD_ESTADO_DOC = '02' 
										and cab.COD_ESTADO_SUNAT = '101' 
										-- and cab.COD_CLIENTE_EMIS = X 
										and cab.FLAG_ENVIO_BOLETAS = '0' 
										and cab.COD_IDEN_CB = 'C'
								) as tempBajas, 
									
								(select 
									COD_TIP_CPE, TXT_SERIE, TXT_CORRELATIVO, COD_CLIENTE_EMIS, COD_ESTADO_DOC, COD_ESTADO_SUNAT 
								from tbl_cpe_cabecera 
								where 
									-- COD_CLIENTE_EMIS = X and 
									COD_IDEN_CB <> 'C' 
									and COD_IDEN_RD <> 'RC') as tempEnv 
						where 
							tempBajas.COD_TIP_CPE = tempEnv.COD_TIP_CPE
							and tempBajas.TXT_SERIE = tempEnv.TXT_SERIE 
							and tempBajas.TXT_CORRELATIVO = tempEnv.TXT_CORRELATIVO 
							and tempBajas.COD_CLIENTE_EMIS = tempEnv.COD_CLIENTE_EMIS 
							and tempEnv.COD_ESTADO_DOC = '01' 
							and tempEnv.COD_ESTADO_SUNAT = '104';
	declare continue handler for not found set done = true;
    
	open CpesR;
	loopy: loop

		fetch CpesR into tempv;
			
		if done then
			leave loopy;
		end if;
		
		update
			tbl_cpe_cabecera set COD_ESTADO_DOC = '01', COD_ESTADO_SUNAT = '104', TXT_RESP ='2'
		where 
			NUM_CPE = tempv;

	end loop;
	close CpesR;

end ;;
DELIMITER ;
