in pCOD_TIP_ESCENARIO char(2)
)
BEGIN

    select 
		NUM_CPE, FK_NUM_CPE_INTERMEDIA, COD_TIP_CPE, TXT_SERIE,
		TXT_CORRELATIVO, COD_TIP_ESCENARIO, FECHA_ENVIO_SUNAT, 
		TICKET_ID_RECEP_SUNAT, FECHA_RECP_SUNAT,
		FEC_GENE_DOC_SUNAT, COD_RPTA_ENVIO_SUNAT, COD_ESTADO_SUNAT, 
		COD_ESTADO_DOC,FLAG_NUM_INT,FLAG_CORREO, COD_IDEN_CB,
		FEC_RECP_DOC2, COD_CLIENTE_EMIS, TXT_RESP 
	from tbl_cpe_cabecera
	WHERE 
		COD_ESTADO_DOC in ('01','05') and 
        COD_ESTADO_SUNAT IN ('101','102','103','104','105') and 
        TXT_RESP = '2' and 
        COD_IDEN_RD <> 'RC' and COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS and 
        COD_TIP_ESCENARIO = pCOD_TIP_ESCENARIO
        
	union
    
	select 
		NUM_CPE, 
        FK_NUM_CPE_INTERMEDIA, 
        COD_TIP_CPE, TXT_SERIE,
		TXT_CORRELATIVO, 
        null as COD_TIP_ESCENARIO, 
        FECHA_ENVIO_SUNAT, 
		TICKET_ID_RECEP_SUNAT, 
        FECHA_RECP_SUNAT,
		FEC_GENE_DOC_SUNAT, 
        COD_RPTA_ENVIO_SUNAT, 
        COD_ESTADO_SUNAT, 
		COD_ESTADO_DOC,
        FLAG_NUM_INT,
        null FLAG_CORREO,
        null COD_IDEN_CB,
		FEC_RECP_DOC2, 
        COD_CLIENTE_EMIS, 
        TXT_RESP 
	from tbl_cpe_cabecera_guia_remision
	WHERE 
		COD_ESTADO_DOC in ('01','05') and 
        COD_ESTADO_SUNAT IN ('101','102','103','104','105') and 
        TXT_RESP = '2' and 
        COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS; 
    
END ;;
