CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_CORREOS_PENDIENTES_POR_CLIENTE`(
in pCOD_CLIENTE_EMIS char(5)
)
begin

	select 
		a.COD_ESTADO_DOC, a.COD_ESTADO_SUNAT, a.NUM_CPE, a.TXT_SERIE, a.TXT_CORRELATIVO, s.TXT_DESCR, a.FEC_EMIS, a.MNT_TOT, a.COD_MND,
		a.COD_CLIENTE_EMIS,a.NUM_IDEN_RECP, c.NOM_RZN_SOC_EMIS, a.NOM_RZN_SOC_RECP, c.NUM_RUC_EMIS, a.COD_TIP_CPE, 
		cpe.TXT_DESCR_CPE, a.TXT_CORREO_ADQUIRIENTE, a.COD_IDEN_CB
	from tbl_cpe_cabecera a 
	inner join tbl_cliente c on a.COD_CLIENTE_EMIS = c.NUM_COD_CLIENTE
	inner join tbl_estd_sunat as s on a.COD_ESTADO_SUNAT = s.COD_ESTD_SUNAT
	inner join tbl_cpe as cpe on a.COD_TIP_CPE = cpe.COD_TIP_CPE
	where
		a.COD_ESTADO_SUNAT in ('102', '103', '105') 
		and a.FLAG_CORREO = '0' 
		and a.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
		and a.COD_IDEN_CB <> 'C'
	order by a.FEC_EMIS, a.COD_TIP_CPE, a.TXT_SERIE, a.TXT_CORRELATIVO;

end ;;
DELIMITER ;
