CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_DOC_ADJUNTOS`(
IN pNUM_CPE int(11),
IN pCOD_TIP_CPE char(2)
)
BEGIN

	/*select cab.NUM_CPE, cli.NUM_RUC_EMIS, cab.NUM_RUC_EMIS , cab.COD_TIP_CPE, cab.TXT_SERIE, cab.TXT_CORRELATIVO, 
    cab.TXT_XML_ENVIO_SUNAT, cab.TXT_XML_RESPUESTA_SUNAT, cab.TXT_PDF_CPE
	from tbl_cpe_cabecera as cab 
	inner join tbl_cliente as cli 
    on cab.COD_CLIENTE_EMIS = cli.NUM_COD_CLIENTE
	where cab.NUM_CPE = pNUM_CPE and cab.COD_CLIENTE_EMIS = '19'; */

	if(pCOD_TIP_CPE = '20') then
    
		select cab.NUM_CPE, cli.NUM_RUC_EMIS, cab.COD_TIP_CPE, cab.TXT_SERIE, cab.TXT_CORRELATIVO, cab.TXT_XML_ENVIO_SUNAT,
		cab.TXT_XML_RESPUESTA_SUNAT, cab.TXT_PDF_CPE
		from tbl_cpe_cabecera_retencion as cab
		inner join tbl_cliente as cli 
        on cab.COD_CLIENTE_EMIS = cli.NUM_COD_CLIENTE
		where cab.NUM_CPE = pNUM_CPE;
        
	else
    
		select cab.NUM_CPE, cli.NUM_RUC_EMIS, cab.COD_TIP_CPE, cab.TXT_SERIE, cab.TXT_CORRELATIVO, cab.TXT_XML_ENVIO_SUNAT,
		cab.TXT_XML_RESPUESTA_SUNAT, cab.TXT_PDF_CPE
		from tbl_cpe_cabecera as cab
		inner join tbl_cliente as cli 
        on cab.COD_CLIENTE_EMIS = cli.NUM_COD_CLIENTE
		where cab.NUM_CPE = pNUM_CPE; 
	
    end if;


END ;;
