CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_PARAMETROS_CLIENTE`(
IN Identificador VARCHAR(30)
)
BEGIN

	select  A.COD_PARAMETRO, 
			A.TXT_NOMBRE, 
            A.TXT_VALOR_PARAMETRO, 
            C.NUM_RUC_EMIS 
    from TBL_CLIENTE_PARAMETROS as A
	inner join tbl_parametros B on A.COD_PARAMETRO = B.COD_PARAMETRO 
	inner Join tbl_cliente C on A.NUM_COD_CLIENTE = C.NUM_COD_CLIENTE 
	where 
		C.NUM_COD_CLIENTE = Identificador 
		or C.NUM_RUC_EMIS = Identificador
    order by A.COD_PARAMETRO;

END ;;
