CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_PENDIENTES_ESTADO_RESUMEN_BOL_NOTAS_BAJAS`(
IN pCOD_CLIENTE_EMIS CHAR(5)
)
BEGIN

select tblTotal.FEC_EMIS, count(tblTotal.NUM_CPE) as CANT_REGISTROS, tblTotal.COD_CLIENTE_EMIS 
	from
		(
        select cab.NUM_CPE, cab.COD_TIP_CPE, date(cab.FEC_EMIS) as FEC_EMIS, cab.COD_ESTADO_DOC, cab.COD_ESTADO_SUNAT, cab.COD_CLIENTE_EMIS, cab.COD_IDEN_CB 
		from tbl_cpe_cabecera as cab 
        -- inner join tbl_cliente as cli on cab.COD_CLIENTE_EMIS = cli.NUM_COD_CLIENTE 
		where
			cab.TXT_SERIE like 'B___' 
			-- and cab.COD_TIP_CPE in ('03', '07', '08') 
			and cab.COD_ESTADO_DOC = '05' 
			and cab.COD_ESTADO_SUNAT = '101' 
			and cab.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS 
			and cab.FLAG_ENVIO_BOLETAS = '0'
			and cab.COD_IDEN_CB <> 'C' 
	union 
		select tempBajas.NUM_CPE, tempBajas.COD_TIP_CPE, date(tempBajas.FEC_EMIS), tempBajas.COD_ESTADO_DOC, tempBajas.COD_ESTADO_SUNAT, tempBajas.COD_CLIENTE_EMIS, tempBajas.COD_IDEN_CB  
			from (
					select 
						cab.NUM_CPE, cab.COD_TIP_CPE, cab.FEC_EMIS, cab.TXT_SERIE, cab.TXT_CORRELATIVO, cab.COD_ESTADO_DOC, cab.COD_ESTADO_SUNAT,
						cab.COD_CLIENTE_EMIS, cab.COD_IDEN_CB 
					from tbl_cpe_cabecera as cab 
					-- inner join tbl_cliente as cli on cab.COD_CLIENTE_EMIS = cli.NUM_COD_CLIENTE 
					where
						cab.TXT_SERIE like 'B___' 
						-- and cab.COD_TIP_CPE IN('03', '07', '08') 
						-- and cab.COD_ESTADO_DOC = '02'
                        and cab.COD_ESTADO_SUNAT = '101'  
						and cab.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS 
						and cab.FLAG_ENVIO_BOLETAS = '0' 
						and cab.COD_IDEN_CB = 'C'
				) as tempBajas /*, 
					
				(select COD_TIP_CPE, TXT_SERIE, TXT_CORRELATIVO, COD_CLIENTE_EMIS, COD_ESTADO_DOC, COD_ESTADO_SUNAT from tbl_cpe_cabecera where COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS and COD_IDEN_CB <> 'C' and COD_IDEN_RD <> 'RC') as tempEnv 	
		where 
			tempBajas.COD_TIP_CPE = tempEnv.COD_TIP_CPE
			and tempBajas.TXT_SERIE = tempEnv.TXT_SERIE 
			and tempBajas.TXT_CORRELATIVO = tempEnv.TXT_CORRELATIVO 
			and tempBajas.COD_CLIENTE_EMIS = tempEnv.COD_CLIENTE_EMIS 
			and tempEnv.COD_ESTADO_DOC = '01' 
			and tempEnv.COD_ESTADO_SUNAT in ('102','103') */
	) as tblTotal
group by date(tblTotal.FEC_EMIS);

END ;;
DELIMITER ;
