CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_SI_EXISTEN_COMUNICACION_BAJA_PENDIENTES`()
begin
	select 
		COD_CLIENTE_EMIS as idCliente, count(*) as cantidad_bajas
	from tbl_cpe_cabecera 
	where
		-- TXT_SERIE like 'F___' 

		COD_ESTADO_DOC = '02' 
		and COD_ESTADO_SUNAT = '101' 
