CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_SI_EXISTEN_CORREOS_PENDIENTES_ENVIO`()
begin
	
	select 
		COD_CLIENTE_EMIS as idCliente, 
        count(NUM_CPE) as CantCorreosPendientes 
	from tbl_cpe_cabecera 
    where 
		COD_ESTADO_SUNAT in ('102', '103', '105') 
        and FLAG_CORREO = '0' 
        and COD_IDEN_CB <> 'C'
        and COD_IDEN_RD <> 'RC'
        -- and COD_CLIENTE_EMIS NOT IN (61,62)
        -- and COD_CLIENTE_EMIS = 5
        -- CLIENTES QUE NO REQUIEREN ENVIO DE CORREO
		and COD_CLIENTE_EMIS NOT IN (97,98,121,54,129)
	group by COD_CLIENTE_EMIS
    order by length(COD_CLIENTE_EMIS), COD_CLIENTE_EMIS;

end ;;
