CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_SI_EXISTEN_CPES_POR_GENERAR_RESUMEN`()
BEGIN

	select 
		COD_CLIENTE_EMIS as idCliente, 
		count(NUM_CPE) as CantCpesPorResumenPendientes 
	from tbl_cpe_cabecera 
	where 
		COD_TIP_CPE in ('03', '07', '08') 
		 and TXT_SERIE like 'B___' 
		and COD_ESTADO_DOC = '05' 
		and COD_ESTADO_SUNAT = '101' 
		and FLAG_ENVIO_BOLETAS = '0' 
        -- and COD_CLIENTE_EMIS <> '1'
        -- and COD_IDEN_CB != 'C'
		-- and COD_CLIENTE_EMIS IN (18)    
	    -- and COD_CLIENTE_EMIS in  (376,205,185)       
        -- and date(fec_emis) = date('2019-08-26')
        --  and FEC_EMIS between '2019-08-26 00:00:00' and '2019-08-26 11:59:59'
        -- and COD_CLIENTE_EMIS in (213)
       -- and date(fec_emis) < date(now())
        -- and NUM_CPE in ('819586','819582','819577')

	group by COD_CLIENTE_EMIS
	order by length(COD_CLIENTE_EMIS), COD_CLIENTE_EMIS;

END ;;
