CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_SI_EXISTEN_TICKETS_COMUNICACION_BAJA_PENDIENTES`()
begin

	select
		cab.COD_CLIENTE_EMIS as idCliente,
		count(cab.NUM_CPE) as CantTicketsBajaPend
	from tbl_cpe_cabecera cab
	where 
		cab.COD_IDEN_CB = 'C' 
		and cab.TXT_SERIE like 'F___' 
		and cab.TICKET_ID_RECEP_SUNAT is not null 
		and cab.TICKET_ID_RECEP_SUNAT <> '' 
		and cab.COD_ESTADO_DOC = '02' 
		and cab.COD_ESTADO_SUNAT = '101' 
        -- and cab.cod_cliente_emis <> '1'
	group by cab.COD_CLIENTE_EMIS
	order by length(cab.COD_CLIENTE_EMIS), cab.COD_CLIENTE_EMIS;

end ;;
