CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_SI_EXISTEN_TICKETS_RESUMEN_PENDIENTES`()
begin

	select 
		res.COD_CLIENTE_EMIS as idCliente, 
		count(res.NUM_CPE_RESUMEN) as CantTicketsResumenPend
	from tbl_cpe_cabecera_resumen_diario res 
	where 
		res.TICKET_ID_RECEP_SUNAT is not null
		and res.COD_ESTADO_DOC ='02'
		and res.COD_ESTADO_SUNAT='101'
        -- and res.cod_cliente_emis <> '1'
	group by res.COD_CLIENTE_EMIS
	order by length(res.COD_CLIENTE_EMIS), res.COD_CLIENTE_EMIS;

end ;;
