CREATE DEFINER=`root`@`%` PROCEDURE `SP_FILTRO_RESUMENES_Y_BAJAS`(
IN pCOD_CLIENTE_EMIS CHAR(5),
IN pFEC_EMIS DATE
)
BEGIN

select  '' as NUMCPE_REGISTROBAJA, 'CPE por declarar' as Mensaje, Cpe.NUM_CPE, Cpe.COD_MND ,cli.TXT_VERS_UBL , cli.TXT_VERS_ESTRUCT_UBL, Cpe.COD_TIP_CPE ,Cpe.TXT_SERIE ,Cpe.TXT_CORRELATIVO , CONCAT(Cpe.TXT_SERIE, '-', Cpe.TXT_CORRELATIVO) As TXT_SERIECORRELATIVO, 
		Cpe.FEC_EMIS, Cpe.COD_IDEN_CB, Cpe.ESTAD_ITEM, Cpe.COD_TIP_NC_ND_REF, Cpe.TXT_CORRELATIVO_CPE_REF, Cpe.TXT_SERIE_REF, Cpe.COD_CPE_REF, CONCAT(Cpe.TXT_SERIE_REF, '-', Cpe.TXT_CORRELATIVO_CPE_REF) As TXT_SERIECORRELATIVOREF, 
		Cpe.COD_ESTADO_DOC, Cpe.COD_ESTADO_SUNAT, Cpe.COD_CLIENTE_EMIS, Cpe.NUM_RUC_EMIS, Cpe.NOM_RZN_SOC_EMIS, Cpe.COD_TIP_NIF_EMIS, Cpe.TXT_DMCL_FISC_EMIS, Cpe.TXT_TOTAL_EN_LETRAS, 
		Cpe.NUM_IDEN_RECP, Cpe.COD_TIP_NIF_RECP, Cpe.MNT_TOT as MNT_TOT, Cpe.MNT_TOT_IGV as MNT_TOT_IGV, Cpe.MNT_TOT_ICBPER, 
		Cpe.MNT_TOT_GRAVADAS as MNT_TOT_GRAVADAS, CASE ISNULL(Cpe.MNT_TOT_GRAVADAS)WHEN 0 THEN '00' ELSE '01' END COD_TIP_GRAVADO, 
		Cpe.MNT_TOT_INAFECTAS as MNT_TOT_INAFECTAS, CASE ISNULL(Cpe.MNT_TOT_INAFECTAS) WHEN 0 THEN '00' ELSE '03' END COD_TIP_INAFECTO, 
		Cpe.MNT_TOT_EXONERADAS as MNT_TOT_EXONERADAS, CASE ISNULL(Cpe.MNT_TOT_EXONERADAS) WHEN 0 THEN '00' ELSE '02' END COD_TIP_EXONERADO, 
		Cpe.MNT_TOT_GRATUITAS as MNT_TOT_GRATUITAS, CASE ISNULL(Cpe.MNT_TOT_GRATUITAS) WHEN 0 THEN '00' ELSE '05' END COD_TIP_GRATUITAS, 
		Cpe.MNT_OTROS_CARGOS as MNT_OTROS_CARGOS, CASE ISNULL(Cpe.MNT_OTROS_CARGOS)WHEN 0 THEN '00' ELSE '06' END COD_TIP_OTROS_CARGOS, 
		Cpe.MNT_TOT_DESC_GLOBAL as MNT_TOT_DESC_GLOBAL, Cpe.MNT_TOT_IGV_ISC as MNT_TOT_IGV_ISC, Cpe.FLAG_NUM_INT as FLAG_NUM_INT 
	from tbl_cpe_cabecera as Cpe inner join tbl_cliente as cli 
	on cli.NUM_COD_CLIENTE = Cpe.COD_CLIENTE_EMIS
		where
			Cpe.TXT_SERIE like 'B___' 			
			and Cpe.COD_ESTADO_DOC = '05' 
			and Cpe.COD_ESTADO_SUNAT = '101' 
			and Cpe.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
			and Cpe.FLAG_ENVIO_BOLETAS = '0' 
			and Cpe.COD_IDEN_CB <> 'C' 
            and date(Cpe.FEC_EMIS) = pFEC_EMIS
union 
	select  tempBajas.NUM_CPE as NUMCPE_REGISTROBAJA, concat('C.B:',tempBajas.NUM_CPE,' esta anulando este doc ->') as Mensaje, tempEnv.NUM_CPE, tempEnv.COD_MND , cliente.TXT_VERS_UBL , cliente.TXT_VERS_ESTRUCT_UBL, tempEnv.COD_TIP_CPE ,tempEnv.TXT_SERIE ,tempEnv.TXT_CORRELATIVO , CONCAT(tempEnv.TXT_SERIE, '-', tempEnv.TXT_CORRELATIVO) As TXT_SERIECORRELATIVO, 
			tempEnv.FEC_EMIS, 'C' as COD_IDEN_CB, '3' as ESTAD_ITEM, tempEnv.COD_TIP_NC_ND_REF, tempEnv.TXT_CORRELATIVO_CPE_REF, tempEnv.TXT_SERIE_REF, tempEnv.COD_CPE_REF, CONCAT(tempEnv.TXT_SERIE_REF, '-', tempEnv.TXT_CORRELATIVO_CPE_REF) As TXT_SERIECORRELATIVOREF, 
			tempEnv.COD_ESTADO_DOC, tempEnv.COD_ESTADO_SUNAT, tempEnv.COD_CLIENTE_EMIS, tempEnv.NUM_RUC_EMIS, tempEnv.NOM_RZN_SOC_EMIS, tempEnv.COD_TIP_NIF_EMIS, tempEnv.TXT_DMCL_FISC_EMIS, tempEnv.TXT_TOTAL_EN_LETRAS, 
			tempEnv.NUM_IDEN_RECP, tempEnv.COD_TIP_NIF_RECP, tempEnv.MNT_TOT as MNT_TOT, tempEnv.MNT_TOT_IGV as MNT_TOT_IGV, tempEnv.MNT_TOT_ICBPER,
			tempEnv.MNT_TOT_GRAVADAS as MNT_TOT_GRAVADAS, CASE ISNULL(tempEnv.MNT_TOT_GRAVADAS)WHEN 0 THEN '00' ELSE '01' END COD_TIP_GRAVADO, 
			tempEnv.MNT_TOT_INAFECTAS as MNT_TOT_INAFECTAS, CASE ISNULL(tempEnv.MNT_TOT_INAFECTAS) WHEN 0 THEN '00' ELSE '03' END COD_TIP_INAFECTO, 
			tempEnv.MNT_TOT_EXONERADAS as MNT_TOT_EXONERADAS, CASE ISNULL(tempEnv.MNT_TOT_EXONERADAS) WHEN 0 THEN '00' ELSE '02' END COD_TIP_EXONERADO, 
			tempEnv.MNT_TOT_GRATUITAS as MNT_TOT_GRATUITAS, CASE ISNULL(tempEnv.MNT_TOT_GRATUITAS) WHEN 0 THEN '00' ELSE '05' END COD_TIP_GRATUITAS, 
			tempEnv.MNT_OTROS_CARGOS as MNT_OTROS_CARGOS, CASE ISNULL(tempEnv.MNT_OTROS_CARGOS)WHEN 0 THEN '00' ELSE '06' END COD_TIP_OTROS_CARGOS, 
			tempEnv.MNT_TOT_DESC_GLOBAL as MNT_TOT_DESC_GLOBAL, tempEnv.MNT_TOT_IGV_ISC as MNT_TOT_IGV_ISC, tempBajas.FLAG_NUM_INT as FLAG_NUM_INT 
	from (	select 
				NUM_CPE, COD_TIP_CPE, FEC_EMIS, TXT_SERIE, TXT_CORRELATIVO, COD_ESTADO_DOC, COD_ESTADO_SUNAT,
				COD_CLIENTE_EMIS, COD_IDEN_CB, FLAG_NUM_INT
			from tbl_cpe_cabecera
			where 
				TXT_SERIE like 'B___'
                and COD_ESTADO_SUNAT = '101' 
                and COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
				and FLAG_ENVIO_BOLETAS = '0' 
				and COD_IDEN_CB = 'C'
                and date(FEC_EMIS) = pFEC_EMIS	) as tempBajas inner join	(	select * from tbl_cpe_cabecera 
																					where COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
																					and COD_IDEN_CB <> 'C'
																					and TXT_SERIE like 'B___'
																					and FLAG_ENVIO_BOLETAS = 1
																					and COD_ESTADO_SUNAT in ('102','103')
																					and COD_IDEN_RD <> 'RC'		) as tempEnv
		on	tempBajas.COD_TIP_CPE = tempEnv.COD_TIP_CPE
			and tempBajas.TXT_SERIE = tempEnv.TXT_SERIE 
			and tempBajas.TXT_CORRELATIVO = tempEnv.TXT_CORRELATIVO
        
		inner join tbl_cliente cliente on tempEnv.COD_CLIENTE_EMIS = cliente.NUM_COD_CLIENTE

 LIMIT 500;
 
 END ;;
DELIMITER ;
