CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_CLIENTE`(
in pNUM_RUC_EMIS varchar(20), 
in pNOM_RZN_SOC_RECP varchar(100),
in pTXT_VERS_UBL char(3),
in pTXT_VERS_ESTRUCT_UBL char(3),
in pCOD_TIP_NIF_EMIS char(1),
in pCOD_UBI_EMIS varchar(10),
in pTXT_DMCL_FISC_EMIS varchar(250), 
in pTXT_PROV_EMIS  varchar(30),
in pTXT_DPT_EMIS varchar(30),
in pTXT_DISTR_EMIS varchar(30), 
in pTXT_URB_EMIS varchar(30), 
in pTXT_RESOLUCION_SUNAT varchar(30),
out pnumcodemisor int(11)
)
BEGIN
    declare resultado int;
     
		select count(*) into resultado from tbl_cliente where NUM_RUC_EMIS = pNUM_RUC_EMIS;
		
        if resultado then
				set pnumcodemisor = 0;
		 else

		 insert into tbl_cliente (
		 NUM_RUC_EMIS,NOM_RZN_SOC_EMIS,TXT_VERS_UBL,TXT_VERS_ESTRUCT_UBL,
					COD_TIP_NIF_EMIS,COD_UBI_EMIS,TXT_DMCL_FISC_EMIS,TXT_PROV_EMIS,TXT_DPTO_EMIS,
					TXT_DISTR_EMIS, TXT_URB_EMIS, TXT_RESOLUCION_SUNAT) 
		 
			values(pNUM_RUC_EMIS ,pNOM_RZN_SOC_RECP, pTXT_VERS_UBL, pTXT_VERS_ESTRUCT_UBL,
					pCOD_TIP_NIF_EMIS, pCOD_UBI_EMIS, pTXT_DMCL_FISC_EMIS , 
					 pTXT_PROV_EMIS, pTXT_DPT_EMIS, pTXT_DISTR_EMIS, pTXT_URB_EMIS,
					 pTXT_RESOLUCION_SUNAT);
					 
		  set pnumcodemisor =   LAST_INSERT_ID();
     
     end if;

END ;;
