CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_RETENCION_CABECERA_FACTURADOR`(
in pNUM_CPE_RETENCION int(11),
in pCOD_TIP_CPE char(2), 
in pCOD_MND char(3), 
in pCOD_ESTADO_DOC char(2), 
in pCOD_ESTADO_SUNAT char(3),
in pCOD_CLIENTE_EMIS char(1), 
in pNUM_RUC_EMIS varchar(11) ,
in pNOM_RZN_SOC_EMIS varchar(100), 
in pCOD_TIP_NIF_EMIS varchar(1), 
in pCOD_UBI_EMIS varchar(10),
in pTXT_DMCL_FISC_EMIS varchar(250), 
in pTXT_URB_EMIS varchar(100), 
in pTXT_PROV_EMIS varchar(100),
in pTXT_DPTO_EMIS varchar(100),
in pTXT_DISTR_EMIS varchar(100), 
in pCOD_PAIS_EMIS varchar(5), 
in pTXT_SERIE char(4),
in pTXT_CORRELATIVO varchar(12),  
in pCOD_TIP_ESCENARIO char(2),

in pNUM_IDEN_PROV varchar(20), 
in pCOD_TIP_NIF_PROV char(1),
in pNOM_RZN_SOC_PROV varchar(120), 
in pCOD_UBI_PROV varchar(10),
in pTXT_DMCL_FISC_PROV varchar(250),
in pTXT_URB_PROV varchar(100),
in pTXT_PROV_PROV varchar(100),
in pTXT_DPTO_PROV varchar(100),
in pTXT_DISTR_PROV varchar(100),
in pCOD_PAIS_PROV varchar(5),

in pTXT_TASA_RETENCION char(2),
in pTXT_PERCENT_TASA decimal(12,2),
in pTXT_OBSERVACIONES varchar(300),

in pFLAG_ENVIO_AUTOMATICO char(1),
in pMNT_TOT_RETENIDO decimal(12,2),
in pMNT_TOT_PAGADO decimal(12,2),

in pFEC_EMIS datetime,
in pFEC_RECP_DOC1 datetime,
in pTXT_CORREO_PROVEEDOR varchar(1000),

out pNumcpe int(11)
)
BEGIN
		  insert into tbl_cpe_cabecera_retencion (FEC_EMIS, TXT_SERIE, TXT_CORRELATIVO, COD_TIP_ESCENARIO,
		  COD_CLIENTE_EMIS , NUM_RUC_EMIS, NOM_RZN_SOC_EMIS, COD_TIP_NIF_EMIS,
		  COD_UBI_EMIS, TXT_DMCL_FISC_EMIS, TXT_PROV_EMIS, TXT_DPTO_EMIS, 
		  TXT_DISTR_EMIS, TXT_URB_EMIS, TXT_COD_PAIS_EMIS, COD_TIP_CPE , COD_MND , 
		  NUM_IDEN_PROV, COD_TIP_NIF_PROV , NOM_RZN_SOC_PROV, COD_UBI_PROV,
		  TXT_DMCL_FISC_PROV, TXT_URB_PROV, TXT_PROV_PROV, TXT_DPTO_PROV, TXT_DISTR_PROV,
		  TXT_COD_PAIS_PROV, TXT_TASA, TXT_PERCENT_TASA, FLAG_CORREO, OBSERVACIONES, FLAG_ENVIO_AUTOMATICO,
		  MNT_TOT_RETENIDO, MNT_TOT_PAGADO, COD_ESTADO_DOC, COD_ESTADO_SUNAT, 
		  FEC_RECP_DOC1, FEC_RECP_DOC2, FLAG_NUM_INT, FK_NUM_CPE_INTERMEDIA, TXT_RESP,TXT_CORREO_PROV)

		  values(pFEC_EMIS, pTXT_SERIE, pTXT_CORRELATIVO, pCOD_TIP_ESCENARIO , pCOD_CLIENTE_EMIS ,pNUM_RUC_EMIS,
			pNOM_RZN_SOC_EMIS,pCOD_TIP_NIF_EMIS,pCOD_UBI_EMIS,pTXT_DMCL_FISC_EMIS ,pTXT_PROV_EMIS,pTXT_DPTO_EMIS,
			pTXT_DISTR_EMIS ,pTXT_URB_EMIS, pCOD_PAIS_EMIS, pCOD_TIP_CPE, pCOD_MND , pNUM_IDEN_PROV, pCOD_TIP_NIF_PROV, 
			pNOM_RZN_SOC_PROV, pCOD_UBI_PROV, pTXT_DMCL_FISC_PROV, pTXT_URB_PROV, pTXT_PROV_PROV, pTXT_DPTO_PROV,
			pTXT_DISTR_PROV, pCOD_PAIS_PROV, pTXT_TASA_RETENCION, pTXT_PERCENT_TASA,'0', pTXT_OBSERVACIONES,
			pFLAG_ENVIO_AUTOMATICO, pMNT_TOT_RETENIDO, pMNT_TOT_PAGADO, pCOD_ESTADO_DOC, pCOD_ESTADO_SUNAT, 
			pFEC_RECP_DOC1, now(), '0', pNUM_CPE_RETENCION, '1',pTXT_CORREO_PROVEEDOR);
			
			set pNumcpe = LAST_INSERT_ID(); 

END ;;
