CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_CPES_REFERENCIADOS_RECHAZADOS_BAJA`(
in pCOD_CLIENTE_EMIS varchar(5)
)
BEGIN
	select 
		c.NUM_CPE, c.COD_TIP_CPE, c.TXT_SERIE,  c.TXT_CORRELATIVO, 
		c.FEC_EMIS, c.FEC_GENER_BAJA, c.COD_IDEN_CB, c.COD_IDEN_COM_BAJA, 
		c.COD_CLIENTE_EMIS, c.COD_ESTADO_DOC, c.COD_ESTADO_SUNAT
	from tbl_cpe_cabecera as c 
	inner join
	(select
			cab.NUM_CPE,cab.COD_TIP_CPE, cab.TXT_SERIE,cab.TXT_CORRELATIVO,
			cab.FEC_EMIS,cab.FEC_GENER_BAJA,cab.COD_IDEN_CB, cab.COD_IDEN_COM_BAJA,
			cab.COD_CLIENTE_EMIS,cab.COD_ESTADO_DOC, cab.COD_ESTADO_SUNAT
		from
		tbl_cpe_cabecera as cab
		where cab.COD_ESTADO_DOC = '01' 
		and cab.COD_ESTADO_SUNAT = '104'
		and cab.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS 
		and cab.COD_IDEN_CB <> 'C'
		and cab.COD_IDEN_RD <> 'RC'
		and cab.TXT_SERIE like 'F___'
	) as cpe
		
	on c.TXT_SERIE = cpe.TXT_SERIE

	and c.TXT_CORRELATIVO = cpe.TXT_CORRELATIVO
	and c.COD_TIP_CPE = cpe.COD_TIP_CPE
	and c.COD_CLIENTE_EMIS = cpe.COD_CLIENTE_EMIS

	where c.COD_ESTADO_DOC = '02' 
	and c.COD_ESTADO_SUNAT = '101' 
	and c.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS 
	and c.COD_IDEN_CB = 'C'
	and (c.FLAG_NUM_INT <= (select TXT_VALOR_PARAMETRO 
							from tbl_cliente_parametros cliparam
							inner join tbl_cliente cl on cliparam.NUM_COD_CLIENTE = cl.NUM_COD_CLIENTE
							where cliparam.COD_PARAMETRO = '020' and cliparam.NUM_COD_CLIENTE = pCOD_CLIENTE_EMIS )) 
	and c.TICKET_ID_RECEP_SUNAT is null

	order by c.COD_CLIENTE_EMIS, c.COD_TIP_CPE, c.FEC_EMIS, 
	c.TXT_SERIE, c.TXT_CORRELATIVO limit 300;
end ;;
DELIMITER ;
