CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_PENDIENTES_ENVIO_RETENCION`(in pcliente int(11) )
BEGIN
  start transaction;
  select cab.NUM_CPE, cab.COD_TIP_CPE from tbl_cpe_cabecera_retencion  as cab 
  inner join tbl_cliente as cli on cab.COD_CLIENTE_EMIS = cli.NUM_COD_CLIENTE 
  where cab.COD_ESTADO_DOC = '02' and cab.COD_ESTADO_SUNAT = '101' 
  and cab.FLAG_NUM_INT = '0' and cab.COD_CLIENTE_EMIS = pcliente
  ORDER BY cab.FEC_EMIS Asc,cab.TXT_SERIE Asc,cab.TXT_CORRELATIVO Asc LIMIT 300;
  commit;
END ;;
