CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_PENDIENTE_COMUNICACION_BAJA_MANUAL`(
in pCOD_CLIENTE_EMIS varchar(2),
in pNUM_CPE int(11)
)
BEGIN

		select 
		cab.NUM_CPE, 
		cab.COD_TIP_CPE, cab.TXT_SERIE, 
		cab.TXT_CORRELATIVO, 
		cab.FEC_EMIS, 
		cab.FEC_GENER_BAJA, cab.COD_IDEN_CB, 
		cab.COD_IDEN_COM_BAJA, cab.COD_CLIENTE_EMIS,
		cab.COD_ESTADO_DOC, cab.COD_ESTADO_SUNAT 
		from tbl_cpe_cabecera as cab 
		inner join
		(select
				c.NUM_CPE,
				c.COD_TIP_CPE, c.TXT_SERIE,
				c.TXT_CORRELATIVO,
				c.FEC_EMIS,
				c.FEC_GENER_BAJA,
				c.COD_IDEN_CB, c.COD_IDEN_COM_BAJA,
				c.COD_CLIENTE_EMIS,
				c.COD_ESTADO_DOC, c.COD_ESTADO_SUNAT
				from tbl_cpe_cabecera as c
				where c.COD_ESTADO_DOC = '01' and c.COD_ESTADO_SUNAT in ('102','103') 
				and c.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS and c.COD_IDEN_CB <> 'C') as cpe

		on cab.TXT_SERIE = cpe.TXT_SERIE
		and cab.TXT_CORRELATIVO = cpe.TXT_CORRELATIVO
		and cab.COD_TIP_CPE = cpe.COD_TIP_CPE
		and cab.COD_CLIENTE_EMIS = cpe.COD_CLIENTE_EMIS
				
		where cab.COD_ESTADO_DOC = '02' and cab.COD_ESTADO_SUNAT = '101' 
		and cab.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS and cab.COD_IDEN_CB = 'C' 
		and cab.FLAG_NUM_INT = '0' and cab.TICKET_ID_RECEP_SUNAT is null
        and cab.NUM_CPE = pNUM_CPE
		ORDER BY cab.FEC_EMIS, cab.TXT_SERIE, cab.TXT_CORRELATIVO;


END ;;
