CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_PENDIENTE_COMUNICACION_BAJA_REINTENTO`(
in pCOD_CLIENTE_EMIS varchar(5)
)
BEGIN
		select
			cab.NUM_CPE,cab.COD_TIP_CPE, cab.TXT_SERIE,cab.TXT_CORRELATIVO,cab.FEC_EMIS,
			cab.FEC_GENER_BAJA,cab.COD_IDEN_CB, cab.COD_IDEN_COM_BAJA,cab.COD_ESTADO_DOC, 
            cab.COD_ESTADO_SUNAT,cab.COD_CLIENTE_EMIS
		from tbl_cpe_cabecera as cab
		inner join
		(select
				cab.NUM_CPE, cab.COD_TIP_CPE, cab.TXT_SERIE, cab.TXT_CORRELATIVO,
				cab.FEC_EMIS, cab.FEC_GENER_BAJA, cab.COD_IDEN_CB, cab.COD_IDEN_COM_BAJA,
				cab.COD_CLIENTE_EMIS, cab.COD_ESTADO_DOC, cab.COD_ESTADO_SUNAT
			from
			tbl_cpe_cabecera as cab
			where cab.COD_ESTADO_DOC = '01' 
            and cab.COD_ESTADO_SUNAT in ('102','103')
			and cab.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS 
            and cab.COD_IDEN_CB <> 'C'
            and cab.COD_IDEN_RD <> 'RC'
			and cab.TXT_SERIE like 'F___'
		) as cpe

		on cab.TXT_SERIE = cpe.TXT_SERIE
        
		and cab.TXT_CORRELATIVO = cpe.TXT_CORRELATIVO
		and cab.COD_TIP_CPE = cpe.COD_TIP_CPE
		and cab.COD_CLIENTE_EMIS = cpe.COD_CLIENTE_EMIS        

		inner join tbl_cliente as cli on cab.COD_CLIENTE_EMIS = cli.NUM_COD_CLIENTE
        
		where cab.COD_ESTADO_DOC = '02' 
        and cab.COD_ESTADO_SUNAT = '101' 
        and cab.COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS 
        and cab.COD_IDEN_CB = 'C'
		and cab.FLAG_NUM_INT <= (select TXT_VALOR_PARAMETRO 
								from tbl_cliente_parametros cliparam
								inner join tbl_cliente cl on cliparam.NUM_COD_CLIENTE = cl.NUM_COD_CLIENTE
								where cliparam.COD_PARAMETRO = '020' and cliparam.NUM_COD_CLIENTE = pCOD_CLIENTE_EMIS )
		and cab.FLAG_NUM_INT <> '0' 
        and cab.TICKET_ID_RECEP_SUNAT is null
		ORDER BY cab.COD_CLIENTE_EMIS, cab.COD_TIP_CPE, cab.FEC_EMIS, 
		cab.TXT_SERIE, cab.TXT_CORRELATIVO LIMIT 300;

END ;;
