CREATE DEFINER=`root`@`%` PROCEDURE `SP_VERIFICAR_CREDENCIALES_Y_RESTRICCION`(
in pUSUARIO varchar(100),
in pPASSWORD varchar(50),
out indentificadorCliente varchar(11)
)
BEGIN

    select NUM_RUC_EMIS into indentificadorCliente
    from tbl_cliente c  
	inner join tbl_cliente_parametros cp on c.NUM_COD_CLIENTE = cp.NUM_COD_CLIENTE
	where cp.TXT_VALOR_PARAMETRO = pUSUARIO and cp.TXT_VALOR_PARAMETRO2 = pPASSWORD; 

	if (indentificadorCliente <> '') then
		select 1;
	else 
		select 0;
    end if;

END ;;
