CREATE DEFINER=`root`@`%` PROCEDURE `SP_VERIFICAR_ESTADO_COMPROBANTE`(
IN pNUM_RUC_EMIS varchar(11),
IN pCOD_TIP_CPE char(2), 
IN pTXT_SERIE char(4), 
IN pTXT_CORRELATIVO char(8),
IN pFEC_EMIS date
)
BEGIN

	IF (pCOD_TIP_CPE IN ('01', '03', '07', '08')) THEN
    	SELECT
			COD_TIP_CPE as CodigoTipoComprobante,
			TXT_SERIE as Serie,
			TXT_CORRELATIVO as Correlativo,
			FEC_EMIS as FechaEmision,
			TICKET_ID_RECEP_SUNAT as TicketSunat, 
			COD_RPTA_ENVIO_SUNAT as CodigoRespuestaSunat, 
			FECHA_ENVIO_SUNAT as FechaEnvioSunat, 
			FECHA_RECP_SUNAT as FechaRecepcionSunat,
			doc.TXT_DESCR_ESTAD_DOC as EstadoDocumentoPortal,
			su.TXT_DESCR as EstadoDocumentoSunat
		FROM tbl_cpe_cabecera cab
		INNER JOIN tbl_estd_sunat su ON su.COD_ESTD_SUNAT = cab.COD_ESTADO_SUNAT
		INNER JOIN tbl_estado_doc doc ON doc.COD_ESTAD_SUNAT = cab.COD_ESTADO_DOC
		WHERE
			NUM_RUC_EMIS = pNUM_RUC_EMIS AND
			COD_TIP_CPE = pCOD_TIP_CPE AND
			TXT_SERIE = pTXT_SERIE AND
			TXT_CORRELATIVO = pTXT_CORRELATIVO AND
			DATE(FEC_EMIS) = pFEC_EMIS;
    END IF;

	IF (pCOD_TIP_CPE = '09') THEN
		SELECT
			COD_TIP_CPE as CodigoTipoComprobante,
			TXT_SERIE as Serie,
			TXT_CORRELATIVO as Correlativo,
			FEC_EMIS as FechaEmision,
			TICKET_ID_RECEP_SUNAT as TicketSunat, 
			COD_RPTA_ENVIO_SUNAT as CodigoRespuestaSunat, 
			FECHA_ENVIO_SUNAT as FechaEnvioSunat, 
			FECHA_RECP_SUNAT as FechaRecepcionSunat,
			doc.TXT_DESCR_ESTAD_DOC as EstadoDocumentoPortal,
			su.TXT_DESCR as EstadoDocumentoSunat
		FROM tbl_cpe_cabecera_guia_remision cab
		INNER JOIN tbl_estd_sunat su ON su.COD_ESTD_SUNAT = cab.COD_ESTADO_SUNAT
		INNER JOIN tbl_estado_doc doc ON doc.COD_ESTAD_SUNAT = cab.COD_ESTADO_DOC
		WHERE
			NUM_RUC_REM = pNUM_RUC_EMIS AND
			TXT_SERIE = pTXT_SERIE AND
			TXT_CORRELATIVO = pTXT_CORRELATIVO AND
			DATE(FEC_EMIS) = pFEC_EMIS;
    END IF;

END ;;
DELIMITER ;
