CREATE DEFINER=`root`@`%` PROCEDURE `SP_VERIFICAR_EXISTENCIA_REGISTRO_COMPROBANTE`(
IN pCOD_CLIENTE_EMIS int,
IN pCOD_TIP_CPE char(2),
IN pTXT_SERIE char(4),
IN pTXT_CORRELATIVO char(8),
IN pES_BAJA bit
)
BEGIN

	if (pCOD_TIP_CPE = '09') then
		select 
			count(*) as contar 
		from tbl_cpe_cabecera_guia_remision 
		where 
				COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
			and COD_TIP_CPE = pCOD_TIP_CPE 
			and TXT_SERIE = pTXT_SERIE 
			and TXT_CORRELATIVO = pTXT_CORRELATIVO;
	end if;
    
	if (pCOD_TIP_CPE = '20') then
		select 
			count(*) as contar 
		from tbl_cpe_cabecera_retencion 
		where 
				COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
			and COD_TIP_CPE = pCOD_TIP_CPE 
			and TXT_SERIE = pTXT_SERIE 
			and TXT_CORRELATIVO = pTXT_CORRELATIVO;
	end if;
    
    if (pCOD_TIP_CPE in ('01', '03', '07', '08') and pES_BAJA = 0) then
		select 
			count(*) as contar 
		from tbl_cpe_cabecera 
		where 
				COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
			and COD_TIP_CPE = pCOD_TIP_CPE 
			and TXT_SERIE = pTXT_SERIE 
			and TXT_CORRELATIVO = pTXT_CORRELATIVO
			and COD_IDEN_CB <> 'C'
			;
	end if;
    
	if (pCOD_TIP_CPE in ('01', '03', '07', '08') and pES_BAJA = 1) then
		select 
			count(*) as contar 
		from tbl_cpe_cabecera 
		where 
				COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS
			and COD_TIP_CPE = pCOD_TIP_CPE 
			and TXT_SERIE = pTXT_SERIE 
			and TXT_CORRELATIVO = pTXT_CORRELATIVO
			and COD_IDEN_CB = 'C'
			;
	end if;

END ;;
DELIMITER ;
