CREATE DEFINER=`root`@`%` PROCEDURE `USP_COMPROBANTESPROCESO`(IN CODIGO_CLIENTE_EMIS INT, IN FECHA_EMISION DATE)
BEGIN
	DECLARE CODIGO_ESTADO_SUNAT INT;
    DECLARE CODIGO_ERROR1 VARCHAR(10);
    DECLARE CODIGO_ERROR2 VARCHAR(10);
    DECLARE RZN_SOCIAL VARCHAR(60);
    DECLARE ERROR_SUNAT VARCHAR(60);
    SET CODIGO_ESTADO_SUNAT := 102;
    
    SELECT c.COD_RPTA_ENVIO_SUNAT,c.COD_ERROR_SUNAT, c.COD_CLIENTE_EMIS, c.NOM_RZN_SOC_EMIS INTO CODIGO_ERROR1, CODIGO_ERROR2, CODIGO_CLIENTE_EMIS, RZN_SOCIAL FROM tbl_errores_sunat er 
    INNER JOIN tbl_cpe_cabecera C ON C.COD_ERROR_SUNAT = er.TXT_COD_ERROR WHERE COD_CLIENTE_EMIS = CODIGO_CLIENTE_EMIS and COD_ESTADO_SUNAT = 101 and DATE(FEC_EMIS) =FECHA_EMISION;
    
    IF (CODIGO_ERROR1 !=  '' || CODIGO_ERROR1 != '0')THEN
		SET ERROR_SUNAT =  CODIGO_ERROR1; -- 'TIENE EL CODIGO RPTA SUNAT *' ||
    ELSEIF (CODIGO_ERROR2 !=  '' || CODIGO_ERROR2 !=  '0')THEN
		SET ERROR_SUNAT = CODIGO_ERROR2; -- 'TIENE EL CODIGO ERROR SUNAT *' || 
	ELSE
		SET ERROR_SUNAT = 'NO TIENE CODIGO SUNAT';
    END IF;
    select concat( 'EL CLIENTE '|| RZN_SOCIAL); -- concat( 'EL CLIENTE '|| RZN_SOCIAL || ' DE CODIGO ' || CODIGO_CLIENTE_EMIS || ' ' || ERROR_SUNAT)
END ;;
DELIMITER ;
